const initState = {}
function setDropDowmValue(preState = initState,action) {
  const { type,data} = action
  switch (type) {
    case 'setDropDowmValue':
      
      return  {...preState,...data}
  
    default:
      return preState
  }
}

export { setDropDowmValue }
